SELECT SUM("name"."id") as agg_0, AVG("person_info"."person_id") as agg_1 FROM "name" LEFT OUTER JOIN "person_info" ON "name"."id" = "person_info"."person_id"  WHERE "person_info"."id" <= 2961082 AND "name"."id" <= 2229958 AND "person_info"."info_type_id" >= 15;
